 of your website, simply copy the shortcode and paste it where desired.'=>'Als u de lijst met tickettypen wilt weergeven met een knop \'Aan winkelwagen toevoegen\' op een bericht of pagina van uw website, kopieert u eenvoudigweg de shortcode en plakt u deze op de gewenste plek.','If you want to enable event data available in the Rest API Please enable this.'=>'Als u gebeurtenisgegevens beschikbaar wilt stellen in de REST API, schakelt u dit in.','If you want to hide the expired event from the calendar please select Yes. Its applicable for the Free Calendar'=>'Als u de verlopen gebeurtenis in de agenda wilt verbergen, selecteert u \'Ja\'. Dit geldt voor de gratis agenda.','If you want to show the date and time in your local timezone, please select Yes.'=>'Als u de datum en tijd in uw lokale tijdzone wilt weergeven, selecteert u Ja.','If you want to show the time zone with the date and time, please select "Yes".'=>'Als u de tijdzone met de datum en tijd wilt weergeven, selecteert u \'Ja\'.','If you want your event to be removed from the list once it is fully booked, you can select "Yes" here.'=>'Als u wilt dat uw evenement uit de lijst wordt verwijderd zodra het volgeboekt is, kunt u hier \'Ja\' selecteren.','If you would like to hide the location details from the order details section on the thank you page and confirmation email body, please choose "Yes". If you would like to show the location details, please choose "No". The default setting is "No".'=>'Als u de locatiegegevens wilt verbergen in het gedeelte met bestelgegevens op de bedankpagina en in de bevestigingsmail, kiest u \'Ja\'. Als u de locatiegegevens wel wilt weergeven, kiest u \'Nee\'. De standaardinstelling is \'Nee\'.','If your event is online or virtual, please ensure that this option is enabled.'=>'Als uw evenement online of virtueel is, zorg er dan voor dat deze optie is ingeschakeld.','If your event list page is loading slowly, you can select this option to improve performance. Keep in mind that selecting this option will disable Waitlist and Seat count features. '=>'Als uw evenementenlijstpagina langzaam laadt, kunt u deze optie selecteren om de prestaties te verbeteren. Houd er rekening mee dat u met deze optie de functies Wachtlijst en Plaatstelling uitschakelt.','If your theme is not loading the Owl Carousel Library, or if you"re having issues with Owl Carousel, you can set this option to "Yes" to fix the issue.'=>'Als uw thema de Owl Carousel-bibliotheek niet laadt of als u problemen ondervindt met Owl Carousel, kunt u deze optie op "Ja" zetten om het probleem te verhelpen.','Image'=>'Afbeelding','image'=>'afbeelding','image Indicator'=>'beeldindicator','Images'=>'Afbeeldingen','images'=>'afbeeldingen','imdb'=>'imdb','In Event Settings area we have slug changing option. You can change it and resave permalink to avoid 404 error.'=>'In het gedeelte \'Evenementinstellingen\' hebben we een optie om de slug te wijzigen. Je kunt dit wijzigen en de permalink opnieuw opslaan om een 404-fout te voorkomen.','In order to add a new tax class, please go to WooCommerce -> Settings -> Tax Area'=>'Om een nieuwe belastingklasse toe te voegen, gaat u naar WooCommerce -> Instellingen -> Belastinggebied','inbox'=>'Postvak IN','indent'=>'inspringen','industry'=>'industrie','Infinite Loop'=>'Oneindige lus','info'=>'informatie','info-circle'=>'info-cirkel','Input Box'=>'Invoerveld','Insert into '=>'Invoegen in','Insert into Speaker'=>'In de luidspreker plaatsen','instagram'=>'Instagram','Install & Active Now'=>'Nu installeren en activeren','internet-explorer'=>'internet-explorer','Invalid product.'=>'Ongeldig product.','ioxhost'=>'ioxhost','It uses WooCommerce to take payment, which provides freedom for using popular payment getaway via WooCommerce. This plugin supports all WordPress version and can be used to create any types of any types of events.'=>'Het gebruikt WooCommerce om betalingen te verwerken, wat de mogelijkheid biedt om populaire betaalmethoden via WooCommerce te